class PalmDetectionModel(SingleImageModel_tfv2):
    class ModelType(CustomEnumBase):
        Mediapipe_2944 = 'mp2944'   #mediapipe model with 2944 anchors
        Mediapipe_2016 = 'mp2016'   #mediapipe model with 2016 anchors
        
    @classmethod
    def get_imgsize_hw_by_model_type(cls, model_type : str) -> tuple[int,int]:
        if model_type == cls.ModelType.Mediapipe_2016:
            return (128,128)
        elif model_type == cls.ModelType.Mediapipe_2944:
            return (256,256)
    
    class ResultKey(CustomEnumBase):
        Detection = 'regressors'
        Confidence = 'classificators'
    
    class Result:
        def __init__(self) -> None:
            self.m_xywh_per_det : np.ndarray = None
            self.m_keypoints_per_det : np.ndarray = None
            self.m_confidence : np.ndarray = None
    
    def __init__(self) -> None:
        super().__init__()
        self.m_model_type : str = None  #see class ModelType
        self.m_palm_to_hand_scale_xy : np.ndarray = np.ones(2)*1.5
        
    def init_by_saved_model(self, model_dir: str, model_type: str):
        self.m_model_type = model_type  # mustr be set first
        super().init_by_saved_model(model_dir)
        
    @property
    def output_detection(self) -> tf.Tensor:
        if not self.m_saved_model:
            return None
        
        if self.m_model_type == self.ModelType.Mediapipe_2016:
            raise NotImplementedError()
        
        for tns in self.m_saved_model.outputs:
            if self.ResultKey.Detection in tns.name:
                return tns
        return None
        
    @property
    def input_size_hwc(self) -> tuple[int, int, int]:
        h,w = self.get_imgsize_hw_by_model_type(self.m_model_type)
        return (h,w,3)
    
    @property
    def anchors_xy(self) -> np.ndarray:
        h,w = self.input_size_hwc[:2]
        return NormalizedAnchors_2944 * np.array([w,h])
    
    def compute_hand_box(self, palm_xywh: np.ndarray, 
                         keypoints : np.ndarray,
                         palm_to_hand_scale_xy : np.ndarray = None) -> Rectangle_2:
        ''' compute the box that encloses the hand. The x_length of the box spans the horizonal range of the hand,
        and the y_length vertical.
        
        parameters
        -------------
        palm_xywh
            (x,y,w,h) bounding box of the palm, where (x,y) is the upper left corner
        keypoints
            7 keypoints returned by palm detector
        palm_to_hand_scale_xy
            (x_scale, y_scale) for scaling the palm box size to enclose the hand
            
        return
        --------
        hand_box
            the box the encloses the hand
        '''
        if self.m_model_type == __class__.ModelType.Mediapipe_2016:
            raise NotImplementedError()
        
        if palm_to_hand_scale_xy is None:
            palm_to_hand_scale_xy = self.m_palm_to_hand_scale_xy
        elif np.isscalar(palm_to_hand_scale_xy):
            palm_to_hand_scale_xy = np.concatenate([palm_to_hand_scale_xy, palm_to_hand_scale_xy])
        
        lower_center = (keypoints[0] + keypoints[5])/2
        upper_center = keypoints[1:5].mean(axis=0)
        palm_dir = upper_center - lower_center
        
        # center = palm_xywh[:2] + palm_xywh[2:]/2
        # center = keypoints[1:5].mean(axis=0)
        center = keypoints.mean(axis=0)
        width, height = palm_xywh[2:] * palm_to_hand_scale_xy
        y_dir = palm_dir / np.linalg.norm(palm_dir)
        x_dir = np.array([-y_dir[1], y_dir[0]])
        out = Rectangle_2.create_from_center_vec(center, width, height, x_dir, y_dir)
        return out
        
    def interpret_model_result(self, model_result : dict) -> list[Result]:
        ''' return a result for each image in the input batch
        '''
        output : list[self.Result] = None
        if self.m_model_type == self.ModelType.Mediapipe_2944:
            return self._interpret_mediapipe_2944(model_result)
        elif self.m_model_type == self.ModelType.Mediapipe_2016:
            return self._interpret_mediapipe_2016(model_result)
            
        return output
    
    @classmethod
    def _interpret_mediapipe_2944(cls, model_result : dict) -> list[Result]:
        # get boxes
        detlist : np.ndarray = model_result[__class__.ResultKey.Detection].numpy()  # (N, 2944,18) anchors
        conflist : np.ndarray = model_result[__class__.ResultKey.Confidence].numpy() #(N, 2944,1) unomrliazed confidence
        
        height, width = cls.get_imgsize_hw_by_model_type(cls.ModelType.Mediapipe_2944)
        anchor_centers = NormalizedAnchors_2944 * np.array([width, height])
        output = []
        for i in range(len(detlist)):
            det = detlist[i] # (2944,18)
            conf = conflist[i] #(2944,1)
            delta_xy = det[:,:2]
            
            det_center = delta_xy + anchor_centers
            det_wh = det[:,[2,3]]
            det_corner = det_center - det_wh/2
            keypts = det[:,4:].reshape((len(det),-1,2)) + anchor_centers[:,np.newaxis,:]
            r = __class__.Result()
            r.m_xywh_per_det = np.column_stack((det_corner, det_wh))
            r.m_confidence = 1/(1+np.exp(-conf))
            r.m_keypoints_per_det = keypts
            output.append(r)
            
        return output
    
